import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <section id="home">
        <h2>Welcome to Hospital Name</h2>
        <p>Your trusted healthcare provider.</p>
      </section>
      <section id="patients">
        <h2>For Patients</h2>
        <div className="module-container">
          <PatientModule />
        </div>
      </section>
      <section id="doctors">
        <h2>For Doctors</h2>
        <div className="module-container">
          <DoctorModule />
        </div>
      </section>
      <section id="admin">
        <h2>Admin Portal</h2>
        <div className="module-container">
          <AdminModule />
        </div>
      </section>
      <footer>
        <p>&copy; 2024 Hospital Name. All rights reserved.</p>
      </footer>
    </div>
  );
}

function Navbar() {
  return (
    <nav className="navbar">
      <ul>
        <li><a href="#home">Home</a></li>
        <li><a href="#patients">Patients</a></li>
        <li><a href="#doctors">Doctors</a></li>
        <li><a href="#admin">Admin</a></li>
      </ul>
    </nav>
  );
}

function PatientModule() {
  return (
    <div className="module">
      <h3>Patient Portal</h3>
      <p>Access your medical records, appointments, and more.</p>
      <a href="/patient/login">Login</a>
    </div>
  );
}

function DoctorModule() {
  return (
    <div className="module">
      <h3>Doctor Portal</h3>
      <p>Manage patient records, appointments, and prescriptions.</p>
      <a href="/doctor/login">Login</a>
    </div>
  );
}

function AdminModule() {
  return (
    <div className="module">
      <h3>Admin Portal</h3>
      <p>Manage hospital operations, staff, and facilities.</p>
      <a href="/admin/login">Login</a>
    </div>
  );
}

export default App;
